Всем привет! 
Открыты несколько позиций Senior Data Scientist в подразделении ЦА ПАО Сбербанк.

Деятельность подразделения направлена на изучение и практическое использование алгоритмов машинного обучения и графовой аналитики для оценки кредитных рисков физических лиц

Работая у нас вы сможете:
•	Работать с «реальными» большими данными;
•	Использовать различные технологии машинного обучения и исследовать их применимость для широкого спектра задач;
•	Разрабатывать модели на основе графов;
•	Разрабатывать Deep-learning нейронные сети;
•	Работать в дружном, молодом и слаженном коллективе
Требования:
•	Высшее образование;
•	Глубокое знание теории вероятностей/математической статистики;
•	Опыт написания запросов к базам данных (SQL и диалекты);
•	Хорошие навыки программирования на Python (Pandas, NumPy, scipy, scikit-learn –обязательный минимум, Pyspark – будет большим плюсом);
•	Большой практический опыт построения математических моделей (желательно навыки построения Deep-Learning нейронных сетей (Keras, Torch), проведение графовой аналитики (желательно Pyspark GraphX));
•	Знание английского языка на уровне intermediate (чтение книг и статей)
•	Готовность осваивать специфику банковской отрасли
•	Способность генерировать идеи и применять на практике


Условия:
•	Профессиональное обучение, семинары, тренинги, конференции;
•	Доход 250+;
•	ДМС, сниженные ставки по кредитованию, программы лояльности для сотрудников;
•	Самые инновационные, амбициозные проекты и задачи;
•	Комфортный офис «Sbergile Home» с просторными опенспейсами, лаунж зонами, кафе, рестораном и оборудованными кухнями;
•	Бесплатный фитнес-зал;
•	Место работы – БЦ Президент Плаза (м. Кутузовская).


